import React from "react";
import {Field, reduxForm} from "redux-form";
import './SignInReduxForm.css'

const SignInForm = (props) => {
    return <form onSubmit={props.handleSubmit}>
        <div className="field">
            <span>Логин</span>
            <Field className={"input"} placeholder={"Email"} name={"email"} component={"input"}/>
        </div>
        <div className="field">
            <span>Пароль</span>
            <Field className={"input"} type={"password"} placeholder={"Password"} name={"password"}
                   component={"input"}/>
        </div>
        <div className="fieldCheck">
            <div>
                <Field component={"input"} name={"rememberMe"} type={"checkbox"}/> Запомнить
            </div>
            <button>ВОЙТИ</button>
        </div>
    </form>
};

const SignInReduxForm = reduxForm({
    form: 'login'
})(SignInForm);

export default SignInReduxForm
